DROP TABLE IF EXISTS dicionario_completo;
CREATE TABLE dicionario_completo(
   Nome       VARCHAR(51) 
  ,Codigo VARCHAR(10)
  ,Tipo   varchar(7)
  ,Decimal2  INTEGER 
  ,Formato  VARCHAR(10)
  ,Variacao   VARCHAR(4)
  ,Inicio     INTEGER 
  ,Fim        INTEGER 
  ,Sinal      VARCHAR(2)
  ,Fonte      VARCHAR(13)
  ,Descricao  VARCHAR(109)
  ,Area       VARCHAR(22)
  ,Localidade VARCHAR(9)
  ,COD_AREA   INTEGER 
  ,COD_LOCAL  INTEGER 
  ,COD_FONTE  INTEGER 
  ,COD_TIPO   VARCHAR(1)
  ,IDX        INTEGER 
);
